// import image
import logo from '../../assets/images/SUNRISE.png'

function Navbar() {
    return (
        <div className="bg-white">
            <div className="row">
                <div className='col-2'>
                    <img src={logo} alt='logo' className='img-fluid'/>
                </div>

            </div>
        </div>
    );
}

export default Navbar;
